import React from "react";

const Guide = ({ name, status, callback = () => {} }) => {
  return (
    <section>
      <div style={{ cursor: "pointer" }} onClick={callback}>
        {name}
      </div>
      <p>{status}</p>
    </section>
  );
};

export default Guide;
